Kakoune supports LSP with the help of kak-lsp . Follow the instructions to install kak-lsp. To configure kak-lsp, refer to the configuration section which is basically about copying the configuration file in the right place (latest versions should use rust-analyzer by default). Finally, you need to configure Kakoune to talk to kak-lsp (see Usage section ). A basic configuration will only get you LSP but you can also activate inlay diagnostics and auto-formatting on save. The following might help you get all of this. eval %sh{kak-lsp --kakoune -s $kak_session} # Not needed if you load it with plug.kak.
hook global WinSetOption filetype=rust %{ # Enable LSP lsp-enable-window # Auto-formatting on save hook window BufWritePre .* lsp-formatting-sync # Configure inlay hints (only on save) hook window -group rust-inlay-hints BufWritePost .* rust-analyzer-inlay-hints hook -once -always window WinSetOption filetype=.* %{ remove-hooks window rust-inlay-hints }
}

