Annotations Source: annotations.rs Provides user with annotations above items for looking up references or impl blocks and running/debugging binaries. Annotations Auto Import Source: auto_import.rs Using the auto-import assist it is possible to insert missing imports for unresolved items. When inserting an import it will do so in a structured manner by keeping imports grouped, separated by a newline in the following order: std and core External Crates Current Crate, paths prefixed by crate Current Module, paths prefixed by self Super Module, paths prefixed by super Example: use std::fs::File; use itertools::Itertools;
use syntax::ast; use crate::utils::insert_use; use self::auto_import; use super::AssistContext; Import Granularity It is possible to configure how use-trees are merged with the imports.granularity.group setting. It has the following configurations: crate: Merge imports from the same crate into a single use statement. This kind of nesting is only supported in Rust versions later than 1.24. module: Merge imports from the same module into a single use statement. item: Don't merge imports at all, creating one import per item. preserve: Do not change the granularity of any imports. For auto-import this has the same effect as item. In VS Code the configuration for this is rust-analyzer.imports.granularity.group. Import Prefix The style of imports in the same crate is configurable through the imports.prefix setting. It has the following configurations: crate: This setting will force paths to be always absolute, starting with the crate prefix, unless the item is defined outside of the current crate. self: This setting will force paths that are relative to the current module to always start with self. This will result in paths that always start with either crate, self, super or an extern crate identifier. plain: This setting does not impose any restrictions in imports. In VS Code the configuration for this is rust-analyzer.imports.prefix. Auto Import Completion With Autoimport Source: flyimport.rs When completing names in the current scope, proposes additional imports from other modules or crates, if they can be qualified in the scope, and their name contains all symbols from the completion input. To be considered applicable, the name must contain all input symbols in the given order, not necessarily adjacent. If any input symbol is not lowercased, the name must contain all symbols in exact case; otherwise the containing is checked case-insensitively. fn main() { pda$0
}
# pub mod std { pub mod marker { pub struct PhantomData { } } } -> use std::marker::PhantomData; fn main() { PhantomData
}
# pub mod std { pub mod marker { pub struct PhantomData { } } } Also completes associated items, that require trait imports. If any unresolved and/or partially-qualified path precedes the input, it will be taken into account. Currently, only the imports with their import path ending with the whole qualifier will be proposed (no fuzzy matching for qualifier). mod foo { pub mod bar { pub struct Item; impl Item { pub const TEST_ASSOC: usize = 3; } }
} fn main() { bar::Item::TEST_A$0
} -> use foo::bar; mod foo { pub mod bar { pub struct Item; impl Item { pub const TEST_ASSOC: usize = 3; } }
} fn main() { bar::Item::TEST_ASSOC
} NOTE: currently, if an assoc item comes from a trait that's not currently imported, and it also has an unresolved and/or partially-qualified path, no imports will be proposed. Fuzzy search details To avoid an excessive amount of the results returned, completion input is checked for inclusion in the names only (i.e. in HashMap in the std::collections::HashMap path). For the same reasons, avoids searching for any path imports for inputs with their length less than 2 symbols (but shows all associated items for any input length). Import configuration It is possible to configure how use-trees are merged with the imports.granularity.group setting. Mimics the corresponding behavior of the Auto Import feature. LSP and performance implications The feature is enabled only if the LSP client supports LSP protocol version 3.16+ and reports the additionalTextEdits (case-sensitive) resolve client capability in its client capabilities. This way the server is able to defer the costly computations, doing them for a selected completion item only. For clients with no such support, all edits have to be calculated on the completion request, including the fuzzy search completion ones, which might be slow ergo the feature is automatically disabled. Feature toggle The feature can be forcefully turned off in the settings with the rust-analyzer.completion.autoimport.enable flag. Note that having this flag set to true does not guarantee that the feature is enabled: your client needs to have the corresponding capability enabled. Debug ItemTree Source: view_item_tree.rs Displays the ItemTree of the currently open file, for debugging. Editor Action Name VS Code rust-analyzer: Debug ItemTree Expand Macro Recursively Source: expand_macro.rs Shows the full macro expansion of the macro at the current caret position. Editor Action Name VS Code rust-analyzer: Expand macro recursively Expand Macro Recursively Expand and Shrink Selection Source: extend_selection.rs Extends or shrinks the current selection to the encompassing syntactic construct (expression, statement, item, module, etc). It works with multiple cursors. Editor Shortcut VS Code Alt+Shift+â†’, Alt+Shift+â† Expand and Shrink Selection File Structure Source: file_structure.rs Provides a tree of the symbols defined in the file. Can be used to fuzzy search symbol in a file (super useful) draw breadcrumbs to describe the context around the cursor draw outline of the file Editor Shortcut VS Code Ctrl+Shift+O File Structure Find All References Source: references.rs Shows all references of the item at the cursor location Editor Shortcut VS Code Shift+Alt+F12 Find All References Folding Source: folding_ranges.rs Defines folding regions for curly braced blocks, runs of consecutive use, mod, const or static items, and region / endregion comment markers. Format String Completion Source: format_like.rs "Result {result} is {2 + 2}" is expanded to the "Result {} is {}", result, 2 + 2. The following postfix snippets are available: format -> format!(...) panic -> panic!(...) println -> println!(...) log: ** logd -> log::debug!(...) ** logt -> log::trace!(...) ** logi -> log::info!(...) ** logw -> log::warn!(...) ** loge -> log::error!(...) Format String Completion Go to Declaration Source: goto_declaration.rs Navigates to the declaration of an identifier. This is the same as Go to Definition with the following exceptions: outline modules will navigate to the mod name; item declaration trait assoc items will navigate to the assoc item of the trait declaration opposed to the trait impl fields in patterns will navigate to the field declaration of the struct, union or variant Go to Definition Source: goto_definition.rs Navigates to the definition of an identifier. For outline modules, this will navigate to the source file of the module. Editor Shortcut VS Code F12 Go to Definition Go to Implementation Source: goto_implementation.rs Navigates to the impl blocks of types. Editor Shortcut VS Code Ctrl+F12 Go to Implementation Go to Type Definition Source: goto_type_definition.rs Navigates to the type of an identifier. Editor Action Name VS Code Go to Type Definition Go to Type Definition Highlight Related Source: highlight_related.rs Highlights constructs related to the thing under the cursor: . if on an identifier, highlights all references to that identifier in the current file .. additionally, if the identifier is a trait in a where clause, type parameter trait bound or use item, highlights all references to that trait's assoc items in the corresponding scope . if on an async or await token, highlights all yield points for that async context . if on a returnorfnkeyword,?character or->return type arrow, highlights all exit points for that context . if on abreak, loop, whileorfortoken, highlights all break points for that loop or block context . if on amoveor|` token that belongs to a closure, highlights all captures of the closure. Note: ?, | and -> do not currently trigger this behavior in the VSCode editor. Hover Source: hover.rs Shows additional information, like the type of an expression or the documentation for a definition when "focusing" code. Focusing is usually hovering with a mouse, but can also be triggered with a shortcut. Hover Inlay Hints Source: inlay_hints.rs rust-analyzer shows additional information inline with the source code. Editors usually render this using read-only virtual text snippets interspersed with code. rust-analyzer by default shows hints for types of local variables names of function arguments types of chained expressions Optionally, one can enable additional hints for return types of closure expressions elided lifetimes compiler inserted reborrows Hover Interpret Function Source: interpret_function.rs Editor Action Name VS Code rust-analyzer: Interpret Function Join Lines Source: join_lines.rs Join selected lines into one, smartly fixing up whitespace, trailing commas, and braces. See this gif for the cases handled specially by joined lines. Editor Action Name VS Code rust-analyzer: Join lines Join Lines Magic Completions Source: lib.rs In addition to usual reference completion, rust-analyzer provides some âœ¨magicâœ¨ completions as well: Keywords like if, else while, loop are completed with braces, and cursor is placed at the appropriate position. Even though if is easy to type, you still want to complete it, to get { } for free! return is inserted with a space or ; depending on the return type of the function. When completing a function call, () are automatically inserted. If a function takes arguments, the cursor is positioned inside the parenthesis. There are postfix completions, which can be triggered by typing something like foo().if. The word after . determines postfix completion. Possible variants are: expr.if -> if expr {} or if let ... {} for Option or Result expr.match -> match expr {} expr.while -> while expr {} or while let ... {} for Option or Result expr.ref -> &expr expr.refm -> &mut expr expr.let -> let $0 = expr; expr.letm -> let mut $0 = expr; expr.not -> !expr expr.dbg -> dbg!(expr) expr.dbgr -> dbg!(&expr) expr.call -> (expr) There also snippet completions: Expressions pd -> eprintln!(" = {:?}", ); ppd -> eprintln!(" = {:#?}", ); Items tfn -> #[test] fn feature(){} tmod -> #[cfg(test)]
mod tests { use super::*; #[test] fn test_name() {}
} And the auto import completions, enabled with the rust-analyzer.completion.autoimport.enable setting and the corresponding LSP client capabilities. Those are the additional completion options with automatic use import and options from all project importable items, fuzzy matched against the completion input. Magic Completions Matching Brace Source: matching_brace.rs If the cursor is on any brace (<>(){}[]||) which is a part of a brace-pair, moves cursor to the matching brace. It uses the actual parser to determine braces, so it won't confuse generics with comparisons. Editor Action Name VS Code rust-analyzer: Find matching brace Matching Brace Memory Usage Source: apply_change.rs Clears rust-analyzer's internal database and prints memory usage statistics. Editor Action Name VS Code rust-analyzer: Memory Usage (Clears Database) Move Item Source: move_item.rs Move item under cursor or selection up and down. Editor Action Name VS Code rust-analyzer: Move item up VS Code rust-analyzer: Move item down Move Item On Enter Source: on_enter.rs rust-analyzer can override Enter key to make it smarter: Enter inside triple-slash comments automatically inserts /// Enter in the middle or after a trailing space in // inserts // Enter inside //! doc comments automatically inserts //! Enter after { indents contents and closing } of single-line block This action needs to be assigned to shortcut explicitly. Note that, depending on the other installed extensions, this feature can visibly slow down typing. Similarly, if rust-analyzer crashes or stops responding, Enter might not work. In that case, you can still press Shift-Enter to insert a newline.

